import { BrowserRouter, Route, Switch } from "react-router-dom";



function App() {

  return (

    <BrowserRouter>
      <Switch>
        <Route>
          <>
            <Header />
            <Switch>
              <Route path="/" component={HomePage} />
              <Route path="/basket" component={Bascet} />
            </Switch>
          </>
        </Route>
      </Switch>
    </BrowserRouter>




  );
}

export default App;
